import React from "react";
import Carousel from "../components/NewsCarousel";
import ProductSection from "../components/ProductSection";

const Home = () => {
    return (
        <div>
            <Carousel />
            <ProductSection title="Composure" />
            <ProductSection title="Mafia Culture" />
            <ProductSection title="FreakSkinz" />
        </div>
    );
};

export default Home;
